import React from 'react';

export default function tHead() {
    return (
        <table>
            <thead>
                <tr>
                    <th>ID:</th>
                    <th>NAME:</th>
                    <th>DEPARTMENT:</th>
                    <th>ROLE:</th>
                    <th>EMAIL:</th>
                </tr>
            </thead>
        </table>
    )
}
